import React from 'react';
import './App.css';
import MainPage from './mainPage/mainpage'
import brain from './icons8-brain-96.png';
import SignInPage from './signInPage/signinpage';


class App extends React.Component {


  constructor() {
    super()
    this.state={
      page: 'main'
    }
  }

  updateImage = (_evnt) => {
    this.setState({imageUrl: _evnt.target.value});
  }

  render() {
    return (
      <div className="App">
        <div className='navigation'>
          <button type='button' id='navBtn' className='glassmorph'>Sign-In</button>
        </div>
        <div className='logo'>
          <span className='glassmorph'><img alt='brain logo' src={brain} width='100px' height='auto'/></span>
        </div>
        <MainPage />
      </div>
    );
  }
}

export default App;
